const styles = theme => ({});

class TaskPlanner extends Component {

    constructor(props){
        super(props);

        this.state = {
            tasks: []
        }
    }

    render() {
        return (
            <div>
                <TaskPlannerDrawer/>
            </div>
        );
    }
}

export default withStyles(styles)(TaskPlanner);
